func (s *Stack) Pop() rune {
    if s.IsEmpty() {
        return 0
    }
    lastIndex := len(s.data) - 1
    popped := s.data[lastIndex]
    s.data = s.data[:lastIndex]
    return popped
}

func (s *Stack) Peek() rune {
