func isValid(s string) bool {
    stack := Stack{}

    for _, ch := range s {
        d := rune(ch)

        if d == '(' || d == '{' || d == '[' {
            stack.Push(d)
        } else if (d == ')' && stack.Peek() == '(') ||
                  (d == '}' && stack.Peek() == '{') ||
                  (d == ']' && stack.Peek() == '[') {
            stack.Pop()
        } else {
            return false
        }
    }

    return stack.IsEmpty()
}

